import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS')</script>";

    // Wait for the search input field to be available
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Fill the search input with the XSS payload
    await page.locator('#searchInput').fill(xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_payload_entered.png'));

    // Find and click the search button
    // Using .first() because there are multiple elements with this class
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });
    await searchButton.click();

    // Take a screenshot after submitting the search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_submitted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_submitted.png'));

    // Extract the value from the input to verify it was entered
    const inputValue = await page.locator('#searchInput').inputValue();

    return {
      success: true,
      action: "Attempted XSS by entering a script payload into the search input and submitting.",
      extractedData: {
        payloadEntered: inputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
